import React from 'react';
import Dropdown from "react-bootstrap/Dropdown";

const SetStatusEl = ({status, setStatus}) => {
	return (
		<Dropdown.Item
			onClick={()=>setStatus(status)}
			className={"text-" + status}
		> {status} </Dropdown.Item>
	);
};

export default SetStatusEl;
